import React from 'react';
import './Navbar.css';

function deneme(){

    return (
        <div className="home-page">
        
        
        <div className="card-container">
               
          <div className="card card-2">
            <div className="progress-container">
              <div className="progress-circle" style={{ '--progress': 70 }} data-progress="70%"></div>
              <div className="progress-circle" style={{ '--progress': 50 }} data-progress="50%"></div>
            </div>
          </div>
          
  
        </div>
  
        
  
      </div>
        
    )
}

export default deneme;
